import react from 'react';
import Data from './Data';
import FicheLogement from './FicheLogement';
import Error404 from './Error404';
function IdCheck() {
  Data.map((element) => {
    if (element.id) {
      return  <FicheLogement />
    } else {
        return <Error404 />
    }
  });
}

export default IdCheck;
